import React from 'react'

function Menucard(props) {
    return (
        <>  
        {props.Menu.map((currele) => {
            return (
        <div className='main-card--cointainer'>

            <div className="card-container">
                <div className="card ">
                    <div className="card-body">
                        <span className="card-number card-circle subtle">{currele.id}</span>
                        <span className="card-author subtle">{currele.category}</span>
                        <h2 className="card-title">{currele.name}</h2>
                        <span className="card-description subtle">
                            {currele.description}
                        </span>
                        <div className="card-read">Read</div>
                    </div>
                    <img src={curreleu.image} alt="images" className="card-media" />

                    <span className="card-tag  subtle">Order Now</span>
                </div>
            </div>
        </div>
            )})}
        </>

    )
}

export default Menucard
